<div id="storeArea"><div tiddler="Lift the lid of the black pot" tags="" modified="201405101549" created="201405101548" twine-position="63,173" modifier="twee">There's licorice inside. You've never been that much of a fan, but maybe\nsomeone you encounter on your quest will like them.\n&lt;&lt;display &quot;Pot actions&quot;&gt;&gt;</div><div tiddler="bg" tags="stylesheet" modified="201405101657" created="201405101655" twine-position="1266,115" modifier="twee">/* Your story will use the CSS in this passage to style the page.\nGive this passage more tags, and it will only affect passages with those tags.\nExample selectors: */\n\nbody {\n\tbackground-image:[[image|zxmbf2]];\n\t\n\t\n}\n.passage {\n\t/* This only affects passages */\n\t\n\t  \n}\n.passage a {\n\t/* This affects passage links */\n\t\n\t\n}\n.passage a:hover {\n\t/* This affects links while the cursor is over them */\n\t\n\t\n}</div><div tiddler="Bar" tags="" modified="201405101456" created="201405101452" twine-position="570,38" modifier="twee">She was just warming up as he took a seat at the bar, with his back to her. A few regulars lingered, nursing their drinks and awaiting the night. She [[hated|Obsession]] most of them. Their leering eyes and lazy expectancy, as if this night would be any different to the last. She surveyed him as she danced. He looked wealthy, and educated. She [[moved|Interest]] slowly and languidly, knowing he could see every inch of her reflected in the mirrors behind the bar. She danced good and he was hers by midnight.</div><div tiddler="leading" tags="" modified="201405101422" created="201405101409" twine-position="160,14" modifier="twee">The years leading up to meeting [[Larry|Larry 1]] had been filled with disappointments. Shed found herself getting sick of people, sick of their superficial bullshit and their complacent lack of intellectualism.</div><div tiddler="Hello macro" tags="script" modified="201405101639" created="201405101611" twine-position="1632,43" modifier="twee">//require jquery\n\nmacros['hello'] =\n{\n\thandler: function()\n\t{\n\t\talert('Hi, reader!');\t\n\t}\n}\n\n\n\npostrender.hello = function(a) {\n   \n    a.className += &quot;hello&quot;; // An example of 'a'\n    console.log(this.title); // An example of 'this'\n\n\n\n// Create the canvas\nvar canvas = document.createElement(&quot;canvas&quot;);\nvar ctx = canvas.getContext(&quot;2d&quot;);\ncanvas.width = 512;\ncanvas.height = 480;\ndocument.body.appendChild(canvas);\n\n// Background image\nvar bgReady = false;\nvar bgImage = new Image();\nbgImage.onload = function () {\nbgReady = true;\n};\nbgImage.src = 'images/background.png';\n\n// Hero image\nvar heroReady = false;\nvar heroImage = new Image();\nheroImage.onload = function () {\nheroReady = true;\n};\nheroImage.src = &quot;images/hero.png&quot;;\n\n// Monster image\nvar monsterReady = false;\nvar monsterImage = new Image();\nmonsterImage.onload = function () {\nmonsterReady = true;\n};\nmonsterImage.src = &quot;images/monster.png&quot;;\n\n// Game objects\nvar hero = {\nspeed: 256 // movement in pixels per second\n};\nvar monster = {};\nvar monstersCaught = 0;\n\n// Handle keyboard controls\nvar keysDown = {};\n\naddEventListener(&quot;keydown&quot;, function (e) {\nkeysDown[e.keyCode] = true;\n}, false);\n\naddEventListener(&quot;keyup&quot;, function (e) {\ndelete keysDown[e.keyCode];\n}, false);\n\n// Reset the game when the player catches a monster\nvar reset = function () {\nhero.x = canvas.width / 2;\nhero.y = canvas.height / 2;\n\n// Throw the monster somewhere on the screen randomly\nmonster.x = 32 + (Math.random() * (canvas.width - 64));\nmonster.y = 32 + (Math.random() * (canvas.height - 64));\n};\n\n// Update game objects\nvar update = function (modifier) {\nif (38 in keysDown) { // Player holding up\nhero.y -= hero.speed * modifier;\n}\nif (40 in keysDown) { // Player holding down\nhero.y += hero.speed * modifier;\n}\nif (37 in keysDown) { // Player holding left\nhero.x -= hero.speed * modifier;\n}\nif (39 in keysDown) { // Player holding right\nhero.x += hero.speed * modifier;\n}\n\n// Are they touching?\nif (\nhero.x &lt;= (monster.x + 32)\n&& monster.x &lt;= (hero.x + 32)\n&& hero.y &lt;= (monster.y + 32)\n&& monster.y &lt;= (hero.y + 32)\n) {\n++monstersCaught;\nreset();\n}\n};\n\n// Draw everything\nvar render = function () {\nif (bgReady) {\nctx.drawImage(bgImage, 0, 0);\n}\n\nif (heroReady) {\nctx.drawImage(heroImage, hero.x, hero.y);\n}\n\nif (monsterReady) {\nctx.drawImage(monsterImage, monster.x, monster.y);\n}\n\n// Score\nctx.fillStyle = &quot;rgb(250, 250, 250)&quot;;\nctx.font = &quot;24px Helvetica&quot;;\nctx.textAlign = &quot;left&quot;;\nctx.textBaseline = &quot;top&quot;;\nctx.fillText(&quot;Goblins caught: &quot; + monstersCaught, 32, 32);\n};\n\n// The main game loop\nvar main = function () {\nvar now = Date.now();\nvar delta = now - then;\n\nupdate(delta / 1000);\nrender();\n\nthen = now;\n};\n\n// Let's play this game!\nreset();\nvar then = Date.now();\nsetInterval(main, 1); // Execute as fast as possible\n\n\n    \n};</div><div tiddler="Larry 1" tags="" modified="201405101435" created="201405101422" twine-position="297,19" modifier="twee">[[Larry|Larry 2]] was as full of shit as anyone. Hed go around telling everyone he was one of the chosen few. She took it for a party trick, and even thought it charmingly naive at first. It was a few months into their romance before she realised it was much more than that. And by then, shed already consented to having his child.</div><div tiddler="Start" tags="" modified="201405101623" created="201405101403" twine-position="25,9" modifier="twee">It was really inspiring at first. Shed felt a renewed sense of hope and belonging. Granted, she was lying to herself, but shed been doing that her entire [[life|leading]].\n\n&lt;&lt;hello&gt;&gt;\n</div><div tiddler="Larry 2" tags="" modified="201405101453" created="201405101435" twine-position="424,36" modifier="twee">Shed noticed one thing about him right away. When he walked into the club that evening, she could tell he was well endowed, and that day at least, lonely as hell and looking to put his talents to [[work|Bar]]. </div><div tiddler="zxmbf2" tags="Twine.image" modified="201405101650" created="201405101650" twine-position="803,79" modifier="twee">data:image/gif;base64,</div><div tiddler="Interest" tags="" modified="201405101535" created="201405101454" twine-position="294,232" modifier="twee">His interest in her, at first, seemed singularly sexual. She was too wise to be flattered but it did add a certain easy convenience to her routine. She didnt have to work so hard, so often. Hed visit her nightly and pay big money for what most got cheap. Hed have her one way, then the other, and then hed finish her off in the shower. The next night, hed return, and display a creativity that was rare, even in her trade.\n\n&lt;&lt;set $flag001 to 1&gt;&gt;\n[[Time|Time]]\n\n</div><div tiddler="Time" tags="" modified="201405101549" created="201405101529" twine-position="455,446" modifier="twee">&lt;&lt;if $flag001 == 1&gt;&gt;Legacy.\n Tomorrow is another day. It's all meaningless. What does he want from me now?&lt;&lt;else&gt;&gt;Now is not the time. (The time is not now. Time is not time Now is not now.) &lt;&lt;endif&gt;&gt;\n\nWhat do you want from me??\n\n:: Pot Chamber\nThe door opens into a narrow sloping corridor which leads into another chamber.\nThe walls are covered with hieroglyphics, and there are three clay pots\nstanding on top of a stone table.\n&lt;&lt;display &quot;Pot actions&quot;&gt;&gt;\n</div><div tiddler="Walk to the archway" tags="" modified="201405101657" created="201405101549" twine-position="1206,358" modifier="twee">You continue on your brave quest...\n\n[[img|zxmbf2]]\n</div><div tiddler="Lift the lid of the white pot" tags="" modified="201405101547" created="201405101547" twine-position="77,336" modifier="twee">There are chocolates inside! And they're delicious.\n&lt;&lt;display &quot;Pot actions&quot;&gt;&gt;</div><div tiddler="Pot actions" tags="" modified="201405101552" created="201405101546" twine-position="584,646" modifier="twee">&lt;&lt;actions &quot;Lift the lid of the white pot&quot; &quot;Lift the lid of the black pot&quot; &quot;Lift the lid of the red pot&quot; &quot;Walk to the archway&quot;&gt;&gt;</div><div tiddler="Obsession" tags="" modified="201405101535" created="201405101456" twine-position="571,190" modifier="twee"> \nHis obsession grew exponentially after the conversation about the child. The topic had arisen one evening, rather casually, while she recovered from a vigorous love making session. He offered her a price unlike any shed imagined, if shed bear him a child.\n\n&lt;&lt;set $flag001 to 0&gt;&gt;\n[[Time|Time]]</div><div tiddler="Lift the lid of the red pot" tags="" modified="201405101549" created="201405101549" twine-position="954,257" modifier="twee">It's empty! Looks like someone got here before you did.\n&lt;&lt;display &quot;Pot actions&quot;&gt;&gt;</div></div></body></html>
